Now, with the Vecos Locker App, you are ready to operate your Vecos locker via your smartphone. Getting yourself a locker is as easy as selecting an available locker from a list. Get access to your locker by pushing the 'open' button in the app. You can now go to your locker to open the door (push-to-open). It is almost magic.

Registering your device takes only a few seconds. With the built-in scanner you can scan the unique QR code of your office, school, hospital, etc. In most situations the QR code can be found at the locker bank. Depending on the way it is configured by the manager it then takes one of the following procedures:

• No procedure, you have direct and immediate access to the lockers;
• You need to register yourself first with your email address, which may then need to be confirmed;
• You need to link your phone to your badge by choosing 'link phone' on the terminal of the locker bank.

